import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import Image from 'react-image-resizer';
var imageCheck = require('../images/check-icon-vector-10850982.jpg');
var companyImage = require('../images/libtery-mutual-logo-CONTENT-2017.jpg')

const GridContainer = () => {
        const availableProducts = {
            0: 'Personal Auto',
            1: 'Personal Home',
            3: 'Dwell fire',
            4: 'Commercial BOP',
            5: 'Commercial BAP',
            6: 'Commercial WC'
        }
        console.log(availableProducts[1]);
        return(
            <Container>
                <Row >
                    <Col xs={3} md={1}>Company</Col>
                    <Col xs={3} md={1}>Personal Auto</Col>
                    <Col xs={3} md={1}>Personal Home</Col>
                    <Col xs={3} md={1}>Dwell fire</Col>
                    <Col xs={3} md={1}>Commercial BOP</Col>
                    <Col xs={3} md={1}>Commercial BAP</Col>
                    <Col xs={3} md={1}>Commercial WC</Col>
                </Row>
                <br></br>
                <Row>
                    <Col xs={3} md={1} style={{justifyContent: 'center'}}>
                        <Image src={companyImage} height={60} width={60}/>
                    </Col>
                </Row>
            </Container>
        )
}

export default GridContainer;
